import React, { useEffect, useState } from "react";

export default function useShowkat() {
  const [data, setData] = useState(null);
  useEffect(() => {
    fetch(url)
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setTodos(data);
      });
  }, [url]);
  return { data };
}
